// eslint-disable-next-line import/no-anonymous-default-export
export default () => {
    // eslint-disable-line no-restricted-globals
    window.self.addEventListener("message", e => {
      if (!e) return;
      console.log('woking worker')

      postMessage('worker is working');
    });
};
